 import React from "react";
 import './ViewDetail.css'
import { Link } from "react-router-dom";
 function ViewDetails(){
    return(
        <div>
            <div className="card">

            <div className="c-card">

                <h3>Student-Id </h3>
                <h3>Student Roll-No</h3>
                <h3>Student Name</h3>
                <h3>Student City</h3>
                <h3>Student Dept</h3>

               <Link to={'/'}> <button>Back</button></Link>


            </div>

            </div>



        </div>
    )
 }
 export default ViewDetails;
